<body>
	<div id="wrap"></div>
	<div id="left_arrow"><img src="./imgs/icon/left1.png"></div>
	<div id="right_arrow"><img src="./imgs/icon/right1.png"></div>
	<div id="panel">
		<div class="item types">
			<img class="title_icon" src="./imgs/icon/ic-folder-b.png">
			<hr/>
			<div id="type_post" name="post" class="type"><span>포스트</span></div>
			<div id="type_moment" name="moment" class="type"><span>모먼트</span></div>
			<div id="type_comment" name="comment" class="type"><span>댓글</span></div>
			<div id="type_all" name="all" class="checked">전체</div>
		</div>
		<div class="item keyword">
			<img class="title_icon" src="./imgs/icon/ic-magnifying-glass-p.png">
			<div id="search_dp"></div>
			<input type="text" class="text" name="keyword" id="search_keyword" autocomplete="off">
			<input type="button" id="search_button" value="검색">
		</div>
		<div class="item date">
			<img class="title_icon" src="./imgs/icon/ic-calendar-p.png">
			<input id="date" type="date" name="date">
			<input type="button" id="move_button" value="이동">
		</div>
	</div>
	<div id="button"><img src="./imgs/icon/button.png"></div>
	<div id="refresh"><img src="./imgs/icon/refresh.png"></div>
	<div id="message"></div>
</body>
</html>
